import React from "react";
import { TabsWithIcon } from "../pages/components/Tabs";
import {
  Square3Stack3DIcon,
  UserCircleIcon,
  Cog6ToothIcon,
} from "@heroicons/react/24/solid";


type DialogAlertProps = {
  open: boolean;
  isOpen: () => void;
};

const Settings: React.FC<DialogAlertProps> = ({ open, isOpen }) => {
  const myTabData = [
    {
      label: "Passwort",
      value: "dashboard",
      icon: Square3Stack3DIcon,
      desc: `It really matters and then like it really doesn't matter. What matters is the people who are sparked by it.`,
    },
    {
      label: "Profile",
      value: "profile",
      icon: UserCircleIcon,
      desc: `Because it's about motivating the doers. Because I'm here to follow my dreams and inspire other people.`,
    },
    {
      label: "Settings",
      value: "settings",
      icon: Cog6ToothIcon,
      desc: `We're not always in the position that we want to be at. We're constantly growing.`,
    },
  ];

  if (!open) return null;


  return (
    <div className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-50">
      <div className="bg-white rounded-lg shadow-lg w-full max-w-md p-6">
        <h2 className="text-xl font-bold mb-4 text-red-500">Einstellungen</h2>
        <TabsWithIcon tabContent={myTabData} />
        <div className="flex justify-end">
          <button onClick={isOpen} className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700">
            Schlie√üen
          </button>
        </div>
      </div>
    </div>
  );
};

export default Settings;
